import React from 'react';
import PropTypes from 'prop-types';

const Select = ({ children, className = "" }) => {
    return (
        <div className={` mb-10 ${className}`}>
            {children}
        </div>
    );
};

Select.propTypes = {
    children: PropTypes.node.isRequired,
};

export default Select;
